    toggleButton();
    toggleButton2();
    handleToggleModal();
  };

  return (
    <>
      <h2>ContextQ1Detail</h2>
      <button onClick={handleClick}>{isModalOpen ? "숨기기" : "보이기"}</button>
      <ContextQ1Detail2 />
    </>
  );
};
